    data: |
      pragma pg
      SELECT - ( - 64 ) + + - col1 AS col1 FROM tab1 WHERE NOT + - col1 NOT BETWEEN + CAST ( + col2 AS INTEGER ) / - 2 AND NULL GROUP BY col1, col1;
  - name: tab1

outputs:
  - name: q9350.out
    data: |
